Reinhard Rohkamm, &quot;Color Atlas of Neurology&quot;
Georg Thieme Verlag 2003 | ISBN-10: 1588901912 | 440 Pages | PDF

Nordwest-Krankenhaus Sanderbusch, Sande, Germany. Pocket atlas offers high-quality color illustrations and detailed information on the diagnosis of symptoms and signs of neurologic disease. Emphasizes conditions most frequently seen in clinical practice. Also includes the fundamentals of the anatomic structure of the nervous system.
